import React from 'react';
import { dashboardStats, collections, routes, notifications } from '../data/sampleData';

const Dashboard = ({ translations }) => {
  const t = translations;

  const formatCurrency = (amount) => {
    return new Intl.NumberFormat('en-US', {
      style: 'currency',
      currency: 'USD'
    }).format(amount);
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'completed': return '#27ae60';
      case 'in-progress': return '#f39c12';
      case 'pending': return '#3498db';
      case 'missed': return '#e74c3c';
      default: return '#7f8c8d';
    }
  };

  const getStatusBadge = (status) => {
    const color = getStatusColor(status);
    return (
      <span 
        style={{ 
          backgroundColor: color, 
          color: 'white', 
          padding: '0.25rem 0.5rem', 
          borderRadius: '4px', 
          fontSize: '0.8rem' 
        }}
      >
        {t[status] || status}
      </span>
    );
  };

  return (
    <div className="main-content">
      <div className="card">
        <div className="card-header">
          {t.dashboardTitle}
        </div>
        <div className="card-body">

          {/* Stats Overview */}
          <div className="stats-grid">
            <div className="stat-card">
              <div className="stat-number">{dashboardStats.totalCollections}</div>
              <div className="stat-label">{t.totalCollections}</div>
            </div>
            <div className="stat-card">
              <div className="stat-number">{dashboardStats.completedToday}</div>
              <div className="stat-label">{t.completedToday}</div>
            </div>
            <div className="stat-card">
              <div className="stat-number">{dashboardStats.pendingCollections}</div>
              <div className="stat-label">{t.pendingCollections}</div>
            </div>
            <div className="stat-card">
              <div className="stat-number">{formatCurrency(dashboardStats.totalRevenue)}</div>
              <div className="stat-label">{t.totalRevenue}</div>
            </div>
            <div className="stat-card">
              <div className="stat-number">{dashboardStats.overduePayments}</div>
              <div className="stat-label">{t.overduePayments}</div>
            </div>
            <div className="stat-card">
              <div className="stat-number">{dashboardStats.activeRoutes}</div>
              <div className="stat-label">{t.activeRoutes}</div>
            </div>
          </div>

          {/* Recent Collections */}
          <div className="card mt-4">
            <div className="card-header">
              {t.upcomingCollections}
            </div>
            <div className="card-body">
              <div className="table-responsive">
                <table className="table">
                  <thead>
                    <tr>
                      <th>{t.address}</th>
                      <th>{t.scheduledDate}</th>
                      <th>{t.collectionType}</th>
                      <th>{t.status}</th>
                      <th>{t.priority}</th>
                    </tr>
                  </thead>
                  <tbody>
                    {collections.slice(0, 5).map((collection) => (
                      <tr key={collection.id}>
                        <td>{collection.address}</td>
                        <td>{new Date(collection.scheduledDate).toLocaleDateString()}</td>
                        <td>{t[collection.type] || collection.type}</td>
                        <td>{getStatusBadge(collection.status)}</td>
                        <td>
                          <span style={{ 
                            color: collection.priority === 'high' ? '#e74c3c' : 
                                   collection.priority === 'urgent' ? '#c0392b' : '#7f8c8d' 
                          }}>
                            {t[collection.priority] || collection.priority}
                          </span>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </div>
          </div>

          {/* Active Routes */}
          <div className="card mt-4">
            <div className="card-header">
              {t.activeRoutes}
            </div>
            <div className="card-body">
              <div className="table-responsive">
                <table className="table">
                  <thead>
                    <tr>
                      <th>Route</th>
                      <th>Driver</th>
                      <th>Truck</th>
                      <th>Progress</th>
                      <th>ETA</th>
                      <th>{t.status}</th>
                    </tr>
                  </thead>
                  <tbody>
                    {routes.map((route) => (
                      <tr key={route.id}>
                        <td>{route.name}</td>
                        <td>{route.driver}</td>
                        <td>{route.truck}</td>
                        <td>
                          <div style={{ display: 'flex', alignItems: 'center' }}>
                            <div style={{
                              width: '100px',
                              height: '8px',
                              backgroundColor: '#ecf0f1',
                              borderRadius: '4px',
                              marginRight: '8px'
                            }}>
                              <div style={{
                                width: `${(route.completedStops / route.stops) * 100}%`,
                                height: '100%',
                                backgroundColor: route.status === 'active' ? '#3498db' : '#27ae60',
                                borderRadius: '4px'
                              }}></div>
                            </div>
                            <span>{route.completedStops}/{route.stops}</span>
                          </div>
                        </td>
                        <td>{route.estimatedCompletion}</td>
                        <td>{getStatusBadge(route.status)}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </div>
          </div>

          {/* Recent Activity */}
          <div className="card mt-4">
            <div className="card-header">
              {t.recentActivity}
            </div>
            <div className="card-body">
              {notifications.map((notification) => (
                <div 
                  key={notification.id}
                  className={`notification notification-${notification.type}`}
                  style={{ opacity: notification.read ? 0.7 : 1 }}
                >
                  <div>
                    <strong>{notification.message}</strong>
                    <div style={{ fontSize: '0.8rem', marginTop: '0.25rem' }}>
                      {new Date(notification.timestamp).toLocaleString()}
                    </div>
                  </div>
                  {!notification.read && (
                    <div style={{ 
                      width: '8px', 
                      height: '8px', 
                      backgroundColor: '#3498db', 
                      borderRadius: '50%' 
                    }}></div>
